  for (let i = 0; i < ACTION_SPACE.length; i++) {
    const other = ACTION_SPACE[i];
    let same = true;
    for (let j = 0; j < other.length; j++) {
      if (other[j] !== offer[j]) {
        same = false;
        break;
      }
    }

    if (same) {
      return 1 + i;
    }
  }

  throw new Error('No matching offer found');
